import {Select} from 'antd';


const Profiles = ()=>{
    const { Option } = Select;
    const children = [];
    for (let i = 10; i < 36; i++) {
    children.push(<Option key={i.toString(36) + i}>{i.toString(36) + i}</Option>);
    }
return(
    <div>
    hello world
         <Select
            mode="multiple"
            style={{ width: '100%' }}
            placeholder="Please select"
            defaultValue={['a10', 'c12']}
            //onChange={handleChange}
            >
        {children}
        </Select>
    </div>
   
)
}
export default Profiles ;
